    ProductReview:
      '\n                    \n                        \uac00\uaca9\uc774 2\ub9cc\uc6d0 \ubbf8\ub9cc\uc778 1\uc778\uc6a9 \ud150\ud2b8\ub97c \ucc3e\uae30 \uc5b4\ub835\ub354\uad70\uc694. \n\uadf8\ub7f0\ub370 \ucfe0\ud321\uc5d0\uc11c 17910\uc6d0\uc778\uac78 \ubcf4\uace0 \uc5bc\ub978 \uad6c\ub9e4.\n\ub2e4\ud589\ud788 \ube68\uac1b\uace0 \ub178\ub797\uace0 \ud55c \ud150\ud2b8\uac00 \uc544\ub2c8\uace0 \uac80\uc815\uc0c9\uacc4\uc5f4\uc774\ub77c \ubb34\ub09c\ud588\uc2b5\ub2c8\ub2e4.\n\uc0c8\ubcbd\ubc30\uc1a1\uc73c\ub85c \uc5ec\ub7ec\uac1c\ub791 \uc11e\uc5ec\uc624\ub294 \ubc14\ub78c\uc5d0 \ub9c8\uc9c0\ub9c9 \uac1c\ubd09\ucc28\ub840\uc600\uc8e0.\n\n\uac1c\ubd09\ud558\uba74 \uccd0\ubd10\uc57c\uc8e0. \uc870\ub9bd\uc774\uc694.\n\n\ud150\ud2b8\ub294 \uc6b0\uc0b0\ucc98\ub7fc \uac00\ubccd\uace0 \uc6d0\ub2e8\ub3c4 \ub531 \uc6b0\uc0b0\ucc9c\uc785\ub2c8\ub2e4.\n\uac80\uc815\uc6b0\uc0b0 \ud070\uac70.\n\n\ud150\ud2b8\ub97c \ub124\ubaa8\uc9c0\uac8c \ud3bc\uce58\uc790 \uac11\uc790\uae30 \uace0\uc591\uc774\uac00 \ub2ec\ub824\ub4e4\uc5b4 \ubc29\ud574\uac00 \ub418 \uc544\uc608 \ud150\ud2b8\uc18d\uc5d0 \ub123\uc5b4\uc8fc\uace0 \uc870\ub9bd\uc744 \uc2dc\uc791, \uc548\uc5d0\uc11c \ubb35\uc9c1\ud558\uac8c \ubc1b\uccd0\uc918\uc11c \ud3b8\ud588\uc5b4\uc694.\n\ud3f4\ub300 \ub450\uac1c \uaf42\uace0 \uac00\uc7a5\uc790\ub9ac\uc5d0 \ub07c\uc6b0\uace0 \uc138\uc6cc\uc11c \uc704\ub97c \ubaa8\uc544 \ubb36\uc740 \ub4a4 \ucc9c\uaf2d\ub300\uae30\ucee4\ubc84\ub97c \uac78\uc5b4\uc8fc\uba74 \ub05d.\n\uac1c\uace0\uc591\uc774\ub4e4\uc774 \uc9c0\ub4e4\uc9d1\uc778 \uc904 \uc54c\uace0 \ub09c\ub9ac\ub3c4 \uc544\ub2d9\ub2c8\ub2e4. \n\uc6d0\ub798\uc788\ub358 \uace0\uc591\uc774\ub294 \uc790\uae30\uc9d1\uc758 \uce68\uc785\uc790 \ub4e4\uc774\ub77c\uace0 \uc8fc\uba39\uc9c8\ud558\uace0 \uc774\uac70 \uc6d0 \ub2e4 \ucc22\uc5b4\ub193\uc744\uae4c \uac71\uc815\uc774 \uc880...\n\n\ucea0\ud551\uc758 \ub85c\ub9dd\uc774 \uc788\uc9c0\ub9cc \uc2e4\uc81c\ub85c 3\ubc88 \ubc16\uc5d0 \uc548\uac14\uace0 \ud070 \ud150\ud2b8\uce58\uace0 \ubb3c\uac74 \uce58\uc6b0\ub294\uac8c \ub108\ubb34 \uadc0\ucc2e\uc544 \uc801\uadf9\uc801\uc73c\ub85c \ub098\uc11c\uc11c \uac00\uc9c0\ub294 \uc54a\uc544\uc694.\n\uadf8\ub7f0\ub370 \ub85c\ub9dd\uc740 \uc548 \uc5c6\uc5b4\uc838\uc11c 1\uc778\uc6a9\uc744 \uc0ac\ubd05\ub2c8\ub2e4.\n\uc9d1\uc5d0\uc11c\ub77c\ub3c4 \uce58\uace0 \uc790\uba74\uc11c \ub85c\ub9dd\uc2e4\ud604\ud558\ub824\uace0.\n\uacb0\uad6d \ud150\ud2b8\ucde8\uce68\uc774 \ud070 \ube44\uc911\uc77c \ub4ef\ud574\uc11c.\n\uac1c\uace0\uc591\uc774\ub4e4\uc5d0\uac8c \uce68\ubc94\ub2f9\ud588\uc5b4\uc694.\n\uc288\ud37c\uc2f1\uae00 \uc0ac\uc774\uc988\uc815\ub3c4 \ub429\ub2c8\ub2e4.\n\n\uc5ec\uae30\uc5d0 \uc624\ub298 \uc774\ubd88\uae54\uace0 \uc790\ub824\uace0 \ud574\uc694.\n\ud55c\ub098\uc808 \ud3bc\uccd0\ub450\uba74 \ub0c4\uc0c8 \uc880 \ub0a0\uc544\uac00\uaca0\uc8e0.\n\uadf8\uc804\uc5d0 \uace0\uc591\uc774\uac00 \ubc1c\ud1b1\uc73c\ub85c \ucc22\uc9c0 \uc54a\uac8c \ubc1c\ud1b1\uae4e\uc544\uc57c\uaca0\uc5b4\uc694.\n\n\uac00\ubccd\uace0 \uce58\uae30\ud3b8\ud558\uace0 \n\uc5ec\ucc28\ud558\uba74 \uc5ec\ub7ff\uc774 \ub4e4\uc5b4\uac00\uc11c \uc798 \uc218\ub3c4 \uc788\uaca0\uc5b4\uc694.\n\uba87 \ub144\uc804 \uc124\uc545\uc0b0\uc744 \uc624\uc0c9\uc57d\uc218\ud130\ucabd\uc73c\ub85c \uc62c\ub77c\uac00\uc11c \ud55c\uacc4\ub839\uc73c\ub85c \ub0b4\ub824\uc624\ub294\ub370 \uc77c\ucc0d \uc62c\ub77c\uac14\ub2e4\uace0 \ubc29\uc2ec\ud558\uace0 \uc624\ub798 \uc26c\uace0 \ud55c\uacc4\ub839\ucf54\uc2a4\ub97c \uc6b0\uc2b5\uac8c \ubcf4\uc558\ub2e4\uac00 \uc0dd\uac01\ubcf4\ub2e4 \uc2dc\uac04\uc774 \ub9ce\uc774 \uac78\ub9ac\ub294 \ubc14\ub78c\uc5d0 \uc870\ub09c\ub2f9\ud560\uae4c\ubd10 \uac81\ub098\uc11c(\ub9c9\ud310\uc5d4 \uac70\uc758 \ub6f0\uc5b4\uc11c) \ubbf8\uce5c\ub4ef\uc774 \ub0b4\ub824\uc628 \uc801\uc774 \uc788\ub294\ub370 \ud574\uac00 \uc9c0\uace0\ub098\uc120 \ub2e4\ud589\ud788 \uacc4\ub2e8\ucf54\uc2a4\uae4c\uc9c0 \uc640\uc11c \uc0b4\uc558\uc8e0. \uadf8\ub7f4 \ub54c \uc774\uac70 \ud558\ub098\uc788\uc5c8\uc73c\uba74 \uc880 \uc548\uc2ec\uc774 \ub418\uc5c8\uc744 \uac83 \uac19\uc544\uc694. \uadf8\uac8c \uc5ec\ucc28\ud558\uba74\uc785\ub2c8\ub2e4.\n\uc2ec\uc9c0\uc5b4 \uc5ec\ub984\uc774\ub77c \ubb3c\uacfc \uc721\ud3ec\uc640 \ucd08\ucf5c\ub9bf\ub9cc \uc794\ub729 \uc2f8\uac16\uace0 \uac00\uc11c\n\uc785\uc740 \ubc18\ud314\ub9d0\uace4 \uae34\uc637\ub3c4 \uc5c6\uace0... \ub0a8\ud3b8\uacfc \uc800\ub294 \uad1c\ucc2e\ub354\ub77c\ub3c4 \uc560\ub4e4\uc774 \ub108\ubb34 \uc5b4\ub9b0(\ud558\uc9c0\ub9cc \uccb4\ub825\uc740 \uc0ac\ub0e5\uac1c\uc218\uc900\uc778) \ucd08\ub529\ub4e4\uc774\ub77c \uc800\uccb4\uc628\uc99d\uc73c\ub85c \uc704\ud5d8\ud560 \uac83 \uac19\uc544 \uc800\uc9c8\uccb4\ub825\uc778 \uc800\ub294 \uc2a4\uc2a4\ub85c\ub97c \ubca0\uc5b4\uadf8\ub9b4\uc2a4\ub77c \ucc29\uac01\uc704\uc7a5\ud558\uace0 \ub6f0\uc5b4\ub0b4\ub824\uc654\ub2e4\ub294 \uc804\uc124\uc774...\n\uadf8\ub54c\uc758 \uc544\ucc14\ud568\uc758 \uc794\uc0c1\ub3c4 \uc774\uac78 \uad6c\uc785\ud568\uc5d0 \ud55c\ubaab\ud588\uc744 \uac81\ub2c8\ub2e4.\n\uc65c \uc9c0\uae08\uc774\ub0d0\uba74 \uac70\uc758 3\ub144\uc744 \uc0b4\uae4c\ub9d0\uae4c\ud558\ub2e4\uac00 \uba70\uce60\uc804 \uc608\ub2a5"\ubc14\ud034\ub2ec\ub9b0 \uc9d1"\uc744 \ubab0\uc544\ubcf4\uace0 "\uc5d0\uc787~"\ud588\uc5b4\uc694. \ub77c\ubbf8\ub780 \ud150\ud2b8\uce58\ub294 \ubaa8\uc2b5\uc774 \uad6c\ub9e4 \ubc29\uc544\uc1e0\ub97c \ub2f9\uacbc\uc8e0. \uc88b\uc544\ubcf4\uc778\ub2e4~\u2665\n\n\uc5b4\ub51c \uac08 \ub550 \uaf2d \ucc59\uaca8\uac08 \uc0dd\uac01\uc774\uc5d0\uc694(\ubb50\ub77c\uace0\ud558\ub354\ub77c \uadf8 \ucea0\ud551\uc6a9 \ub3d7\uc790\ub9ac\uc640 \ud568\uaed8\uc694. \uc880 \ud479\uc2e0\ud55c \uadf8\uac70).\n\uc694\uc998 \uc2dc\uad6d\uc5d0 \uc5b4\ub51c \uac08\uc9c4 \ubaa8\ub974\uaca0\ub2e4\ub9cc. \uadf8\ub798\uc11c \uc800\ub834\ud55c \uac78 \uc6d0\ud55c \uac83\ub3c4 \uc788\uc8e0. \uc548\uc4f8\uac78 \ube44\uc2f8\uac8c \uc8fc\uba74 \ube44\uc2fc\uc4f0\ub808\uae30\uac00 \ub418\ub2c8\uae4c.\n\n\n\ubc31\ud328\ucee4\uc5d0\uac90 \uac00\ubcbc\uc6cc\uc11c \ud6cc\ub96d\ud55c \uce5c\uad6c\uac00 \ub420 \uac83 \uac19\uc544\uc694.\n                    \n                ',
